%[text] %[text:anchor:T_666E1525] # Sample Distributions
%[text] **Overview**
%[text] A universal characteristic in human anatomy is that their parts vary: Height, Weight, foot size, spacing between the eyes. These parts all use the same template, but vary in dimension. But, when you look at the distribution of the measurements of the human parts taken from a random sampling of humans, they tend to form a very characteristic shape known as the bell curve.  In fact, the bell curve shape was so common, they called it a "Normal" curve (They also call it a Gaussian curve, after the mathematician Gauss).
%[text] MATLAB Skills Covered
%[text] - groot
%[text] - nexttile
%[text] - plotting
%[text] - creating structures
%[text] - creating your own functions \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_B74C04C0] ## Reset MATLAB
close all
clearvars
%%
%[text] %[text:anchor:H_A3851106] ### Global Font Setting
%[text] The default font size of plots in MATLAB is rather small and not really suitable for publication. Also, the figure background is gray.
%[text] Instead of changing the figure color and having to increase the font size each time you create a plot, you can call the following line of code once, and the default font size will automatically be set to 16 and the background set to white. You need to run this each time you restart MATLAB.
set(groot, 'defaultAxesFontSize', 16, 'defaultFigureColor','w');
%[text] - nothing seems to happen but the defaults have changed.  \
%%
%[text] %[text:anchor:H_96C63FB6] ## Normal distributions
%[text] When analyzing data, it is critical to visualize the distribution of the data. This will give you some important information on how to proceed with the analysis.
figure(Visible="on")
%%
%[text] The function **randn** creates a random set of numbers that are normally distributed
data_Normal = randn(1000,1)*100+300; % vector of random, normally distributed numbers 
%[text] - 1000 rows, 1 column
%[text] - Multiplying by 100 makes all the numbers fall in the hundreds range \
%%
%[text] %[text:anchor:H_4976AF8E] ### Plot the Normal distribution
%[text] We use the function **histogram** to plot the distribution. 
histogram(data_Normal) %[output:9926a44e]
xlabel('value'); ylabel('frequency') %[output:9926a44e]
%[text] - The most frequent value is in the middle
%[text] - The less frequent values are in the tails \
%%
%[text] %[text:anchor:H_DEDD8A2C] ### Measurements of Central Tendency
%[text] So, why do we so often report the mean and standard deviation when we are measuring stuff? It  has to do with the normal curve.
%[text] Let's calculate the following measurements
%[text] - **mean** - the average or most common value
%[text] - **standard deviation** - measure of how dispersed the data is in relation to the mean
%[text] - **median** - the middle value \
%[text] Here we use **dot notation** to create a structure, *s,* that organizes all of our measurements
s.data = data_Normal; % copy the normal data to the structure
s.desc = 'Normal'; % description of the data
s.mean = mean(s.data); % mean
s.median = median(s.data); % median
s.std = std(s.data) % standard deviation %[output:18406ef0]
%[text] - Using dot notation here creates a structure, *x*.
%[text] - We'll use *x* to keep track of all the stats \
%%
%[text] %[text:anchor:H_7D71B5FA] ### Re-plot Histogram and indicate measures of Central tendency
%[text] Here, we clear the plot (using **clf**), re-plot the histogram, and then add a vertical line to the plot using the function **xline**
histogram(s.data,FaceAlpha=0.15) % plot the histogram of data %[output:158554b3]
title(sprintf('%s Distribution',s.desc)) %[output:158554b3]
xlabel('value'); ylabel('frequency') %[output:158554b3]
xline(s.mean,'b','Mean') % add vertical line %[output:158554b3]
%%
%[text] %[text:anchor:H_93C6FE46] #### Now you try: 
%[text] - Add an xline for the median.
%[text] - Make it magenta and dashed ('m--')
%[text] - label as Median and Move the Horizontal Alignment to the left (LabelHorizontalAlignment) \

%[text] - How close are the Mean and Median? \
%%
%[text] %[text:anchor:H_2B32EDF1] #### Standard deviation
%[text] What does the standard deviation tell us? 
xline(s.mean+s.std,'m','+1SD') % +1SD %[output:1cb15794]
xline(s.mean-s.std,'m','-1SD') % -1SD %[output:1cb15794]
%[text] - The mean sets the middle of the curve
%[text] - The standard deviation indicates the width \
%%
%[text] %[text:anchor:H_2AD001CB] #### Change the Standard Deviation 
%[text] Now you try. Here we use Probability Density Function (PDF - a math function) to create a normal curve. 
%[text] Move the sliders to change the shape of the curve
my_mean = -12; % adjust the mean %[control:slider:9c18]{"position":[11,14]}
my_std = 4; % adjust the standard deviation %[control:slider:4fde]{"position":[10,11]}
pd = makedist("Normal","mu",my_mean,"sigma",my_std); % creates a normal curve object
plot(pd) % plots the normal curve %[output:496f25bc]
xlim([-50 50]) % sets the x limits %[output:496f25bc]
ylabel('Probability Density Function') %[output:496f25bc]
%[text] - a small SD results in a narrow curve
%[text] - a large SD results in a broad curve \
%[text] 
%%
%[text] %[text:anchor:H_F70A4E91] ### Normal Probability Density Function (PDF)
%[text] Read more about [PDF here](https://en.wikipedia.org/wiki/Probability_density_function)
%[text] So, as you can see, with just a mean and a standard deviation you can determine the shape of a normal curve. 
%[text] Once you have established this curve, then you can determine the probability of a measurement in relation to the mean, as shown in this figure
%[text] ![](text:image:462a)
%[text] Notice that most measurements (68%) fall within one standard deviation (ùúé) of the mean (¬µ). Within 2 standard deviations, you have 95.45% of the measurements. And within 3 standard deviations, you have 99.73% of all the measurements
%%
%[text] %[text:anchor:H_AE6C32DF] ## Non-parametric Distributions
%[text] Often distributions are described as either Parametric (normal) or Non-parametric.
%[text] Non-parametric distributions can look like a normal curve, but have an asymmetry or skew to the curve. For example, this code creates a dataset with a skewed distribution (code from here:  [site](https://www.mathworks.com/help/stats/exploratory-analysis-of-data.html))
rng default  % For reproducibility
data_Nonparametric = [normrnd(4,1,1,350),normrnd(6,0.5,1,650)]'*100; % numeric array - skewed data
%%
%[text] %[text:anchor:H_B220DBD8] #### **Now you try:** 
%[text] %[text:anchor:H_A72CE552] Populate the *s* structure with the [measurements of central tendency](internal:H_DEDD8A2C) of the nonparametric data (dataNonNorm) by
%[text] 1. Clicking on  [measurements of central tendency](internal:H_DEDD8A2C)  link (blue text)
%[text] 2. Copying the code from that code block
%[text] 3. Paste the code here
%[text] 4. change to the first line to contain data\_Nonparametric (instead of data\_Normal)
%[text] 5. change the description to 'Nonparametric'
%[text] 6. Execute this code block \

%%
%[text] %[text:anchor:H_66FA620E] #### Display the nonparametric  data as a histogram
%[text] 1. Copy the code from this code block:  [a histogram with the mean xline](internal:H_7D71B5FA)
%[text] 2. Paste here
%[text] 3. Run this code block  \

%[text] - Here the peak of the curve is not in the center of the distribution \
%%
%[text] %[text:anchor:H_3D7E577D] ### Packaging our code into Functions
%[text] The code above was written in such as a way to be easily copied and pasted, and then re-used with only minor changes. Functions are like this, but without all of the copying and pasting.
%[text] We can create a function to calculate all of the measurements of central tendencies
function Z = calcCentralTendencies(DATA)
% Calculate Measures of Central Tendency and add to Z
Z.data = DATA; % set data 
Z.desc = extractAfter(inputname(1),'_'); % get name of inputted variable. Extract the part after the underscore
Z.mean = mean(Z.data); % Calculate the mean
Z.median = median(Z.data); % Calculate the median
Z.std = std(Z.data); % Calculate the std deviation
end
%[text] - The input is DATA and the output is the structure Z
%[text] - try running this code block (nothing should happen) \
%%
%[text] **Now you try**
%[text] Call our new function to calculate the measures of central tendencies of data\_Normal

%[text] - Notice that DATA or Z is not added to the workspace
%[text] - Repeat with the other data vectors
%[text] - Notice that the field 'desc' has the name of the variable that you input (after the underscore) \
%%
%[text] Here we create we create another function called **myHistOverlay** that plots the histogram and overlay the xlines
function myHistOverlay(DATA)

Z = calcCentralTendencies(DATA); % Call our other function inside this function
Z.desc = extractAfter(inputname(1),'_'); % get name of inputted variable

% Plot the data
histogram(Z.data,FaceAlpha=0.15); % plot the histogram of data
title(sprintf('%s Distribution', Z.desc)) % add the title
xlabel('value'); ylabel('frequency') % label the x and y axes

% add xlines
xline(Z.mean,'b','Mean')
xline(Z.median,'m--','Median')
xline(Z.mean+Z.std,'r', 'SD+1')
xline(Z.mean-Z.std,'r', 'SD-1')
end
%[text] - The input is DATA
%[text] - There is no output
%[text] - This function calls our other function **calcCentralTendencies** \
%%
%[text] %[text:anchor:H_BE87583F] #### Now you try
%[text] Call **myHistOverlay** to plot the Normal Data

%%
%[text] %[text:anchor:H_9C9667C3] ### Multiple Plots in the Same Figure
%[text] The function **nexttile** adds multiple axes to the same figure
figure(Visible='on') %[output:802a08a6]
nexttile % turn tiling on %[output:802a08a6]
%%
%[text] Every time you call **nexttile,** an axes gets added to the figure
nexttile %[output:4b161191]
%[text] - try running this code block multiple times \
%%
%[text] %[text:anchor:H_58BEB846] #### Plotting multiple Histograms in the same figure
%[text] Here, we use the function **myHistOverlay** to plot the three different data vectors. By using a function, we don't have to copy the same code over and over again. 
figure(Visible="on")
%%
nexttile % add first axes %[output:49d076d5]
myHistOverlay(data_Normal); %[output:49d076d5]

nexttile % add second axes %[output:49d076d5]
myHistOverlay(data_Nonparametric); %[output:49d076d5]

nexttile % add third axes %[output:49d076d5]
data_Uniform = rand(1000,1)*800; % numeric array - uniform data
myHistOverlay(data_Uniform); %[output:49d076d5]
%[text] - add the function **tiledlayout** with an input of "horizontal" to make the tiles occupy one row
%[text] - Histograms require a lot of horizontal space to properly view the distributions
%[text] - change the input into tiledlayout to an input of  \
%%
%[text] %[text:anchor:H_66A83493] ## Other Types of Distribution Plots
%[text] Different plots give you different information 
%%
%[text] %[text:anchor:H_0E62ECC2] ### Box Plots
%[text] 
%[text] Here we plot a histogram and a box plot of the Normal data. And we'll do it all in the same figure using the function **nexttile** to turn on tiling.
figure(Visible="on")
%%
clf % clears any tiling %[output:806357be]

s = calcCentralTendencies(data_Normal); %

nexttile % turn on tiling and set first tile %[output:806357be]
histogram(s.data) %[output:806357be]
xline(s.median,'m--') % plot median line %[output:806357be]
title('histogram') %[output:806357be]

nexttile % set second tile %[output:806357be]
boxchart(s.data); %[output:806357be]
title('box plot') %[output:806357be]
%[text] - Notice now that we have two plots in one figure
%[text] - Also notice that the default orientation of a box plot is rotated 90Àö compared to the orientation of a histogram. \
%%
%[text] %[text:anchor:H_8F259093] #### Change Box Plot orientation for comparison
%[text] We can rotate a box plot to the horizontal orientation by setting Orientation to "horizontal"
hb = boxchart(s.data,Orientation="horizontal"); %[output:554a4492]
%[text] Now this is a little easier to compare
%[text] - The line in the middle is the median
%[text] - The box represents the interquartile range: 25%-75%
%[text] - The whiskers represent the total range of the data \
%[text] Box plots exchange precision for simplicity.
%[text] -  A little easier to read a box plot versus a histogram.
%[text] - But you loose some information (cant' see the shape of the curve)
%[text] - The fact that the median is in the dead center of the interquartile range *suggests* that the distribution is normal \
%%
%[text] How does the interquartile range compare to ¬± 1 SD?
xline(s.mean+s.std,'m','+1SD') % +1SD line %[output:9a78b7f7]
xline(s.mean-s.std,'m','-1SD') % -1SD line %[output:9a78b7f7]
%[text] - interquartile range contains 50% of the data
%[text] - ¬± 1SD contains 67% of the data \
%%
%[text] %[text:anchor:H_E736EFD0] ### The swarm chart and box plot
%[text] A swarm chart plots every single data point, jittering the x-position to separate all the points. 
%[text] - Swarm charts require both an x and y vector
%[text] - Since we just have one group of data, we can se the x to a vector of ones that are the same size as the data \
figure(Visible="on") %[output:6ecf1ac4]
x = ones(1, numel(data_Normal)); % create a vector of ones
y = data_Normal; % set y to the data
swarmchart(x,y, 'filled',MarkerFaceAlpha=0.5) %[output:6ecf1ac4]
yline(median(data_Normal),'r--') %[output:6ecf1ac4]
%[text] - The distinct shape of the plot gives an indication of the distribution of the data.
%[text] - Here, the symmetrical nature of the plot around the median (red line) indicates a normal distribution \
%%
%[text] Often, swarm charts and box plots are plotted together
hold on %[output:88447dc4]
boxchart(x,y) %[output:88447dc4]
%%
%[text] %[text:anchor:H_7743439C] ### Box plot Swarm Chart function
%[text] Just like for the histogram, we can create a function to simplify overlaying box and swarm charts together. 
%[text] The function is called **myBoxSwarmChart** and it takes one input, Y. Input the data into Y
function myBoxSwarmChart(Y)

desc = extractAfter(inputname(1),'_'); % get name of inputted variable

X = ones(size(Y));
swarmchart(X,Y, 'filled',MarkerFaceAlpha=0.5)
hold on
boxchart(X,Y)
title(desc)
end
%%
%[text] %[text:anchor:H_B94BD656] #### **Now you try**
%[text] - Create a figure with 3 horizontal tiles.
%[text] - Use **myBoxSwarmChart** to plot the Normal, Nonparametric, and Uniform data \

%[text] - Easier to represent the data in a tighter space
%[text] - However, using just the boxplot does accurately represent the distribution of the data
%[text] - In the nonparametric plot, the median is not in the center of the boxplot \
%%
%[text] %[text:anchor:H_A39B64C3] ## Sample Size
%[text] The larger the sample size, the easier to identify the distribution. And vice versa.
%[text] The following code creates three different normally-distributed variables with different sample sizes: 500, 100, and 20
data_Norm500 = randn(500,1)*100+300; % vector of random, normally distributed numbers 
data_Norm100 = randn(100,1)*100+300;
data_Norm20 = randn(20,1)*100+300;
%%
%[text] %[text:anchor:H_19B283DA] ### Plot Histograms
%[text] So, what do these distributions look like? Let's have a look
figure(Visible="on")
%%
%[text] With our bespoke functions, we can easily see how the distributions differ depending on Sample Size

clf %[output:4a4afa09]
tiledlayout("vertical") %[output:4a4afa09]

nexttile %[output:4a4afa09]
myHistOverlay(data_Normal) %[output:4a4afa09]
xlim([-100 700]) %[output:4a4afa09]
%[text] - add code to add histograms of data\_Norm500, data\_Norm100, and data\_Norm20  \
%%
%[text] %[text:anchor:H_483ECBE0] ### Plot Box Plots Swarm Charts
%[text] How does the data look as box plots?
clf %[output:46b1da3f]
tiledlayout("horizontal") %[output:46b1da3f]

nexttile %[output:46b1da3f]
myBoxSwarmChart(data_Normal) %[output:46b1da3f]

